import React from 'react';
import './severity.scss';


const Severity = () => {
    return (
      <div>
        <div class="severity">
          <div className="square-level2"></div>
          <div className="square-level2"></div>
          <div className="square-level0"></div>
          <div className="square-level0"></div>
        </div>
      </div>
    );
}

export default Severity;
